import React from 'react';
import {Redirect, Route, Switch} from "react-router-dom";
import {privateRoutes, publicRoutes} from "../../../router";

const AppRouter = () => {
    const isAuth = true;
    return (
        isAuth
            ? <Switch>
                {privateRoutes.map(route =>
                    <Route component={route.component}
                           path={route.path}
                           exact={route.exact}/>
                )}
            </Switch>
            : <Switch>
                {privateRoutes.map(route =>
                    <Route component={route.component}
                           path={route.path}
                           exact={route.exact}/>
                )}

            </Switch>
    );
};

export default AppRouter;
